import React from 'react';
import styled from 'styled-components';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import StoryEle from './storyEle';

const StoryDiv=styled.div`
  border-radius:3px;
  border:solid 1px #dbdbdb;
  padding:16px 0;
  width:700px;
  height:122px;
  margin-left:100px;
  position:absolute;
`
function Story() {
  const setting={
    dots:true,
    slidesToShow:9,
    slidesToScroll:5,
    speed:500,
    arrow:true,
    infinite:false
  }
  return (
    <StoryDiv>
      <Slider {...setting}>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
        <StoryEle/>
      </Slider>
    </StoryDiv>
  );
}

export default Story;
